class Solution {
  int maximumBeauty(List<int> nums, int k) {
    nums.sort();
    int maxBeauty = 1;
    List<int> minRequired = List.filled(nums.length, 0);
    minRequired[0] = nums[0];
    for (int i = 1; i < nums.length; i++) {
      minRequired[i] = nums[i] - k;
    }

    for (int i = 0; i < nums.length; i++) {
      int currentNum = nums[i] + k;
      int count = 1;
      for (int j = i + 1; j < nums.length; j++) {
        if (minRequired[j] <= currentNum) {
          count++;
        } else {
          break;
        }
      }
      maxBeauty = max(maxBeauty, count);
    }
    return maxBeauty;
  }

  int max(int a, int b) {
    return a > b ? a : b;
  }
}
